// Adapted from https://gitlab.com/pymarc/pymarc/-/blob/main/pymarc/marc8_mapping.py
// MARC-8 Code Tables: https://www.loc.gov/marc/specifications/specchartables.html

pub fn get_odd_char(code_point: u32) -> Option<char> {
    match code_point {
        0x21203D => Some('\u{2026}'), // HORIZONTAL ELLIPSIS
        0x212040 => Some('\u{201C}'), // LEFT DOUBLE QUOTATION MARK
        0x7F2014 => Some('\u{2014}'), // EM DASH
        0x7F2019 => Some('\u{2019}'), // RIGHT SINGLE QUOTATION MARK
        0x7F2020 => Some('\u{201D}'), // RIGHT DOUBLE QUOTATION MARK
        0x7F2122 => Some('\u{2122}'), // TRADE MARK SIGN
        _ => None,
    }
}

pub fn get_superscript(code_point: u32) -> char {
    match code_point {
        0x28 => '\u{207D}', // SUPERSCRIPT OPENING PARENTHESIS / SUPERSCRIPT LEFT PARENTHESIS
        0x29 => '\u{207E}', // SUPERSCRIPT CLOSING PARENTHESIS / SUPERSCRIPT RIGHT PARENTHESIS
        0x2B => '\u{207A}', // SUPERSCRIPT PLUS SIGN
        0x2D => '\u{207B}', // SUPERSCRIPT HYPHEN-MINUS / SUPERSCRIPT MINUS
        0x30 => '\u{2070}', // SUPERSCRIPT DIGIT ZERO
        0x31 => '\u{B9}',   // SUPERSCRIPT DIGIT ONE
        0x32 => '\u{B2}',   // SUPERSCRIPT DIGIT TWO
        0x33 => '\u{B3}',   // SUPERSCRIPT DIGIT THREE
        0x34 => '\u{2074}', // SUPERSCRIPT DIGIT FOUR
        0x35 => '\u{2075}', // SUPERSCRIPT DIGIT FIVE
        0x36 => '\u{2076}', // SUPERSCRIPT DIGIT SIX
        0x37 => '\u{2077}', // SUPERSCRIPT DIGIT SEVEN
        0x38 => '\u{2078}', // SUPERSCRIPT DIGIT EIGHT
        0x39 => '\u{2079}', // SUPERSCRIPT DIGIT NINE
        _ => {
            panic!("Fix me")
        }
    }
}

pub fn get_greek_symbol(code_point: u32) -> char {
    match code_point {
        0x61 => '\u{3B1}', // GREEK SMALL LETTER ALPHA
        0x62 => '\u{3B2}', // GREEK SMALL LETTER BETA
        0x63 => '\u{3B3}', // GREEK SMALL LETTER GAMMA
        _ => {
            panic!("Fix me")
        }
    }
}

pub fn get_subscript(code_point: u32) -> char {
    match code_point {
        0x28 => '\u{208D}', // SUBSCRIPT OPENING PARENTHESIS / SUBSCRIPT LEFT PARENTHESIS
        0x29 => '\u{208E}', // SUBSCRIPT CLOSING PARENTHESIS / SUBSCRIPT RIGHT PARENTHESIS
        0x2B => '\u{208A}', // SUBSCRIPT PLUS SIGN
        0x2D => '\u{208B}', // SUBSCRIPT HYPHEN-MINUS / SUBSCRIPT MINUS
        0x30 => '\u{2080}', // SUBSCRIPT DIGIT ZERO
        0x31 => '\u{2081}', // SUBSCRIPT DIGIT ONE
        0x32 => '\u{2082}', // SUBSCRIPT DIGIT TWO
        0x33 => '\u{2083}', // SUBSCRIPT DIGIT THREE
        0x34 => '\u{2084}', // SUBSCRIPT DIGIT FOUR
        0x35 => '\u{2085}', // SUBSCRIPT DIGIT FIVE
        0x36 => '\u{2086}', // SUBSCRIPT DIGIT SIX
        0x37 => '\u{2087}', // SUBSCRIPT DIGIT SEVEN
        0x38 => '\u{2088}', // SUBSCRIPT DIGIT EIGHT
        0x39 => '\u{2089}', // SUBSCRIPT DIGIT NINE
        _ => {
            panic!("Fix me")
        }
    }
}

